  [],\n\t\"revision_timestamp\": \"2016-04-05T00:01:26.299361\",\n\t\"name\": \"enviroatlas-domestic-water-demand-by-12-digit-huc-for-the-conterminous-united-states\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas dataset includes domestic
  water demand attributes which provide insight into the amount of water currently
  used for indoor and outdoor residential purposes in the contiguous United States.
  The values are based on 2005 water demand and 2010 population distribution, and
  have been summarized by watershed or 12-digit hydrologic unit code (HUC). For the
  purposes of this metric, domestic water use includes residential uses, such as for
  drinking, bathing, cleaning, landscaping, and pools. Depending on the location,
  domestic water can be self-supplied, such as by private wells, or publicly-supplied,
  such as by municipalities. Sources include either surface water or groundwater.
  Estimates are for primary residences only (i.e., excluding second homes and tourism
  rentals). This dataset was produced by the US EPA to support research and online
  mapping activities related to the EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas)
  allows the user to interact with a web-based, easy-to-use, mapping application to
  view and analyze multiple ecosystem services for the contiguous United States. The
  dataset is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas)
  or as an EnviroAtlas map service. Additional descriptive information about each
  attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
  (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
